    function create_pdf(data) {
        var Form = 'data:image/jpeg;base64,';

        var check_mark = 'data:image/png;base64,';


        var doc = new jsPDF('p', 'mm', 'letter');

        doc.setFontStyle('bold');
        doc.setTextColor('#123643');
        doc.addImage(Form, 'JPEG', 0, 0, 215.9, 279.4);

        // FORM DATA

        // ULI
        doc.setFontSize(12);
        let uli_x = 57;
        let uli_y = 51.5;
        let uli = data.uli.split('-').join('');

        for (i in uli) {
            doc.text(uli_x, uli_y, uli[i]);
            uli_x += 6.37;
        }



        doc.setFontSize(8);
        // entry date
        doc.text(172, 50.5, data.entry_date);

        // last name
        doc.text(42, 65.5, data.last_name);
        // first name
        doc.text(103, 65.5, data.first_name);
        // middle name
        doc.text(164, 65.5, data.middle_name);

        // house_num/street
        doc.text(42, 79, data.house_num_street);
        // barangay
        doc.text(103, 79, data.barangay);
        // district
        doc.text(164, 79, data.district);
        // city/municipality
        doc.text(42, 92.5, data.municipality);
        // province
        doc.text(103, 92.5, data.province);
        // region
        doc.text(164, 92.5, data.region);

        // email/fb
        doc.text(42, 106, data.email);
        // contact
        doc.text(103, 106, data.contact);
        // nationality
        doc.text(164, 106, data.nationality);


        if (data.sex === 'male') {
            // sex_male
            doc.addImage(check_mark, 'PNG', 23, 125.5, 2, 2.5);

        }
        else {
            // sex_female
            doc.addImage(check_mark, 'PNG', 23, 130.3, 2, 2.5);
        }


        if (data.civil_status === 'single') {
            // civil_status_single
            doc.addImage(check_mark, 'PNG', 71.6, 125.5, 2, 2.5);
        }
        else if (data.civil_status === 'married') {
            // civil_status_married
            doc.addImage(check_mark, 'PNG', 71.6, 130, 2, 2.5);
        }
        else if (data.civil_status === 'widowed') {
            // civil_status_widowed
            doc.addImage(check_mark, 'PNG', 71.6, 134.7, 2, 2.5);
        }
        else if (data.civil_status === 'separated') {
            // civil_status_separated
            doc.addImage(check_mark, 'PNG', 71.6, 139.5, 2, 2.5);
        }


        if (data.employment_status === 'employed') {
             // employed
            doc.addImage(check_mark, 'PNG', 134, 125.5, 2, 2.5);
        }
        else {
             // unemployed
            doc.addImage(check_mark, 'PNG', 134, 130.1, 2, 2.5);
        }



        // month_of_birth
        doc.text(37, 150.5, data.birthdate.split('-')[0]);
        // day_of_birth
        doc.text(81, 150.5, data.birthdate.split('-')[1]);
        // year_of_birth
        doc.text(127.5, 150.5, data.birthdate.split('-')[2]);
        // age
        doc.text(171, 150.5, data.age);


        // birthplace_city/municipality
        doc.text(37, 165.5, data.bplace_city_municipality);
        // birthplace_province
        doc.text(105, 165.5, data.bplace_province);
        // birthplace_region
        doc.text(166, 165.5, data.bplace_region);


        if (data.attainment === 'No Grade Completed') {
            // attainment_no_grade_completed
            doc.addImage(check_mark, 'PNG', 13.2, 178.3, 2, 2.5);
        }
        else if (data.attainment === 'Pre-School (Nursery/Kinder/Preparatory - Level)') {
            // attainment_pre_school
            doc.addImage(check_mark, 'PNG', 59.5, 178.3, 2, 2.5);
        }
        else if (data.attainment === 'Elementary Undergraduate') {
            // attainment_elementary_udergraduate
            doc.addImage(check_mark, 'PNG', 110.9, 178.3, 2, 2.5);
        }
        else if (data.attainment === 'High School Undergraduate') {
            // attainment_highschool_udergraduate
            doc.addImage(check_mark, 'PNG', 162.5, 178.3, 2, 2.5);
        }
        else if (data.attainment === 'High School Graduate') {
            // attainment_highschool_graduate
            doc.addImage(check_mark, 'PNG', 13.2, 183.8, 2, 2.5);
        }
        else if (data.attainment === 'Post Secondary') {
            // attainment_post_secondary
            doc.addImage(check_mark, 'PNG', 59.5, 183.8, 2, 2.5);
        }
        else if (data.attainment === 'College Undergraduate') {
            // attainment_college_udergraduate
            doc.addImage(check_mark, 'PNG', 110.9, 183.8, 2, 2.5);
        }
        else if (data.attainment === 'College Graduate or Higher') {
            // attainment_college_graduate_or_higher
            doc.addImage(check_mark, 'PNG', 162.5, 183.8, 2, 2.5);
        }


        if (data.classification === 'Person with Disability') {
            // classification_PWD
            doc.addImage(check_mark, 'PNG', 18.7, 194.7, 2, 2.5);
        }
        else if (data.classification === 'Displaced Worker') {
            // classification_displaced_worker
            doc.addImage(check_mark, 'PNG', 18.7, 199.6, 2, 2.5);
        }
        else if (data.classification === 'Overseas Filipino Worker') {
            // classification_OFW
            doc.addImage(check_mark, 'PNG', 18.7, 204.6 , 2, 2.5);
        }
        else if (data.classification === 'Overseas Filipino Worker Dependent') {
            // classification_OFW_Dependent
            doc.addImage(check_mark, 'PNG', 18.7, 209.4 , 2, 2.5);
        }
        else if (data.classification === 'Overseas Filipino Worker Repatriate') {
            // classification_OFW_repartiate
            doc.addImage(check_mark, 'PNG', 71.7, 194.7, 2, 2.5);
        }
        else if (data.classification === 'Victims/Survivors of Human Trafficking') {
            // classification_victim/survivor_of_human_trafficking
            doc.addImage(check_mark, 'PNG', 71.7, 199.6, 2, 2.5);
        }
        else if (data.classification === 'Indegenus People and Cultural Communities') {
            // classification_indigenous_people_and_cultural_community
            doc.addImage(check_mark, 'PNG', 71.7, 204.6 , 2, 2.5);
        }
        else if (data.classification === 'Rebel Returnees') {
            // classification_rebel_returnee
            doc.addImage(check_mark, 'PNG', 71.7, 209.4 , 2, 2.5);
        }
        else if (data.classification === 'Solo Parent') {
            // classification_solo_parent
            doc.addImage(check_mark, 'PNG', 144.9, 194.7, 2, 2.5);
        }
        else if (data.classification === 'Parent Dependent') {
            // classification_others
            doc.addImage(check_mark, 'PNG', 144.9, 199.6, 2, 2.5);
        }

        if (data.has_taken) {
            // has_taken_ncae_yes
            doc.addImage(check_mark, 'PNG', 88.8, 219.9, 2, 2.5);

            // taken_where
            doc.text(34, 228, data.has_taken_where);
            // taken_when
            doc.text(34, 234, data.has_taken_when);
        }
        else {
            // has_taken_ncae_no
            doc.addImage(check_mark, 'PNG', 147.8, 219.9, 2, 2.5);
        }



        // Course
        doc.setFontSize(12);
        doc.text(51, 246, data.course);

        // pdf_name
        doc.save(data.pdf_name);
    }